import Typography from '@mui/material/Typography';
import AppBar from '@mui/material/AppBar';
import setDrawerOpen from '@mui/material/Drawer';
function ModifierRecette() {
  return (
    <div>
      <h1>Modifier votre recette</h1>
      {/* Ajoutez ici le formulaire de cr√©ation de recette */}
    </div>
  );
}
<AppBar position="static" color="primary">
          <Toolbar>
            <IconButton
              edge="start"
              sx={{ mr: 2 }}
              color="inherit"
              aria-label="menu"
              onClick={() => setDrawerOpen(true)}
            >
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" color="inherit" component="div">
             Modification de votre recette
            </Typography>
          </Toolbar>
        </AppBar>


export default ModifierRecette;
